export default function Todos_list() {
  const todos = [
    { id: 1, Description: "Learn AWS" },
    { id: 2, Description: "Learn cloud" },
    { id: 3, Description: "Learn python" },
    { id: 4, Description: "Learn Java" },
    { id: 5, Description: "Learn Rubby" },
  ];
  return (
    <div className="Todos_list">
      <h1>Things You want to do !</h1>

      <div className="table">
        <table>
          <thead>
            <th>ID</th>
            <th>Description</th>
          </thead>

          <tbody>
            {todos.map((todo) => {
              <tr>
                <td>{todo.id}</td>
                <td>{todo.Description}</td>
              </tr>;
            })}
          </tbody>
        </table>
      </div>
    </div>
  );
}
